{
  "advertisements": [
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "1. Es sucht jemand einen sichern Schweibzang mit aller Zugehördt und schöner Haxon, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "2. Man begehrt eine Chaise nit 4 Räder zu etwann 3 Pläzen und zu einem Pferd samt gehörigem Geschihr, der Liebhaber ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "3. Wer hier oder auf dem Land noch neuen Träder-Brandtewein Ohnweiss zu verkaufen hat, kan im Berichtshaus einen Käufer dazu derselben, wie auch zu einem mittelmäßigen Sponton, so ebenfalls begehrt wird, beydes ohne Entgeld im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "4. Es sucht jemand eine gute, solide und ungefähr einen Saum haltende Feuerspritzen ums tragen oder zum führen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "5. Es sucht jemand einen möglichen Kron- Leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne Gelfte-Lapa zu laufen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "7. Es verlangt jemand einen glatten nußbäumern prächtfrigen Kasten, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu laufen begehert :",
      "text": "8. Man verlangt einen noch guten Rachel-Ofen mittelmäßiger Größe mit oder ohne Zuff, der Liebhaber ist im Berichtshaus zu erfragen; leidet aber keinen Verzug."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "1. Ein Losament mitten im Offenburger Hof, wie der Augenschein zeigen wird, auf nächste Kafnacht- oder Wängi-Fronfalten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "2. Ein-faubereres Losament an der Spalen von einer Studen und Nebenkammer, oder nach Belieben zwei Kammern samt einem Pferden Sommerhaus, alles auf einem Boden, und nach Seltenen Stellung und Heubühne, auf Wängi-Fronfalten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "3. Ein Losament mit einem schönen Laden und Laden-Stüblein nebst einem grossen Sommerhaus, Stuben, Kuchin, 2 grosse Kammern, einem besondern Keller, Holshaus, ein beschoßenes Bauchhaus, auf der Eifengaff, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "4. Ein Losament in der Fröschgaff von einer Stuben, 2 Kammern und Blag zum Holz, auf Wängi-Fronfalten zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "5. Ein Losament für 2 Personen in der Weissen Gaff, bestehend aus einem Stüblein und Meßofen, Blag zum Hauskraß zu stellen, auf einem Boden, wie auch Plag zum Holz, Bruns nen um Haus, a 15 Wind Zins des Jahres, kan gleich bezogen werden, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "6. Ein schönes Losament ebenes Hufses auf einem Boden von 3 Stuben, einem grossen Saal, Kammern, Kuchin, Keller, Blag zum Holz, Zuckrit zum Bauchhaus, und, so beliebig, einem Garten in der Kiechheimer Vorhaff, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "7. Eine grosse doppelte Freucht-Schütte auf E. E. Gesellschaft zum Höhen Rupf."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "8. Bis den 15sten dff wird eine fangende Hündin begehrt, um etliche junge Hunde zu auferziehen, gegen einer Erkantlichkeit: wo sich anzumelden, ist im Berichtshaus ohne Entgeld zu vernehmen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert :",
      "text": "9. Auf künftige Weihnacht ist unter der St. Peters-Schul ein geräumiges Magazin zu verleihen, darum sich in dem Schulhaus anzumelden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehert :",
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatus Theologia, der neben andern auch die französische Sprach verstände, zu einem Haus-Präceptor begehrt, weshalb sich im Berichtshaus zu melden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehert :",
      "text": "2. Man verlangt einen Menschen in eine Fabriek, der sich zu allerley Haus-Geschäften brauchen ließe, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehert :",
      "text": "3. Man sucht einen Stallknecht in ein Wirthshaus, im Berichtshaus zu erfragen."
    }
  ]
  }
